import React from 'react';
import { HorizontalBar } from 'react-chartjs-2'

/* 5 - Com relação às disciplinas que queria cursar, você conseguiu se matricular em: */

const Gcinco = () => {
    return (
        <HorizontalBar
            data={{
                labels: [
                    'Todas', 'Algumas', 'Nenhuma', 'Não Responderam'
                ],

                datasets: [
                    {
                        data: [708, 788, 48, 23],
                        backgroundColor: '#EEAD2D',
                        barThickness: 'flex',
                        hoverBackgroundColor: "#b8831c",
                    },
                ],
            }}
            height={100}
            width={100}
            options={{
                maintainAspectRatio: false,
                layout: {
                    padding: 60,
                },

                legend: {
                    display: false,
    /*                         labels: {
                        fontSize: 15,
                        fontColor: "#e6e7ea",
                        fontFamily: 'Roboto',
                    },
    */
                },

                title: {
                    display: true,
                    padding: 20,
                    text: "você conseguiu se matricular em:",
                    fontSize: 25,
                    fontColor: "#e6e7ea",
                    fontFamily: 'Roboto',
                },

                scales: {
                    yAxes:[
                        {
                            barPercentage: 1,

                            gridLines: {
                                color: "rgba(0, 0, 0, 0)",
                            },

                            ticks: {
                                beginAtZero: true,
                                fontSize: 14,
                                fontColor: "#e6e7ea",
                                fontFamily: 'Roboto',
                            },

                            barThickness: 23,
                        },
                    ],

                    xAxes:[
                        {
                            display: false,
                            gridLines: {
                                color: "rgba(0,0,0,0)",
                            },
                        }
                    ],
                },
            }}
        />
    );
};

export default Gcinco;
